import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Footer from './Footer';

const Landing = () => {
  const navigate = useNavigate();
  const [isHovering, setIsHovering] = useState(false);

  // Floating meme images effect
  const floatingMemes = [
    { emoji: "🚀", delay: "0s" },
    { emoji: "💎", delay: "1s" },
    { emoji: "🌕", delay: "2s" },
    { emoji: "🦍", delay: "3s" },
    { emoji: "🌟", delay: "4s" }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-900 via-black to-purple-900 text-white overflow-hidden">
      {/* Animated background */}
      <div className="fixed inset-0 overflow-hidden pointer-events-none">
        {floatingMemes.map((meme, index) => (
          <div
            key={index}
            className="absolute text-4xl animate-float"
            style={{
              left: `${Math.random() * 100}%`,
              animationDelay: meme.delay,
              top: `-50px`
            }}
          >
            {meme.emoji}
          </div>
        ))}
      </div>

      {/* Navigation */}
      <nav className="sticky top-0 z-50 bg-black/40 backdrop-blur-md border-b border-white/10">
        <div className="container mx-auto px-6 py-4">
          <div className="flex items-center justify-between">
            <div className="flex items-center gap-2">
              <span className="text-3xl">🎭</span>
              <div className="text-2xl font-bold bg-clip-text text-transparent bg-gradient-to-r from-purple-400 to-pink-600 animate-pulse">
                Sepolia.fun
              </div>
            </div>
            <div className="flex items-center gap-6">
              <a href="#features" className="hover:text-purple-400 transition-colors">Features</a>
              <a href="#memes" className="hover:text-purple-400 transition-colors">Meme Gallery</a>
              <a href="#how-it-works" className="hover:text-purple-400 transition-colors">How It Works</a>
              <button
                onClick={() => navigate('/home')}
                className="px-6 py-2 bg-gradient-to-r from-purple-600 to-pink-600 hover:from-purple-700 hover:to-pink-700 rounded-lg font-semibold transition-all transform hover:scale-105 hover:shadow-lg"
              >
                Launch App 🚀
              </button>
            </div>
          </div>
        </div>
      </nav>

      {/* Hero Section */}
      <div className="relative container mx-auto px-6 pt-32 pb-24">
        <div className="max-w-4xl mx-auto text-center">
          <div className="mb-4 flex justify-center">
            <div className="text-6xl animate-bounce">🎭</div>
          </div>
          <h1 className="text-7xl font-bold mb-8 animate-fade-in">
            <span className="bg-clip-text text-transparent bg-gradient-to-r from-purple-400 via-pink-500 to-red-500">
              Meme Magic
            </span>
            <br />
            Meets DeFi
          </h1>
          <p className="text-xl mb-12 text-gray-300">
            Turn your wildest meme dreams into tokens! The most entertaining way to launch your meme token 
            <span className="animate-pulse"> 🚀</span>
          </p>

          <div className="flex justify-center gap-6">
            <button
              onMouseEnter={() => setIsHovering(true)}
              onMouseLeave={() => setIsHovering(false)}
              onClick={() => navigate('/home')}
              className="group px-8 py-4 bg-gradient-to-r from-purple-600 to-pink-600 hover:from-purple-700 hover:to-pink-700 rounded-lg font-semibold text-lg transition-all transform hover:scale-105 hover:shadow-lg hover:shadow-purple-500/25 relative overflow-hidden"
            >
              <span className="relative z-10 flex items-center gap-2">
                Launch Your Meme 
                <span className={`transition-transform ${isHovering ? 'translate-x-2' : ''}`}>🚀</span>
              </span>
              <div className="absolute inset-0 bg-gradient-to-r from-yellow-400 to-pink-500 opacity-0 group-hover:opacity-100 transition-opacity" />
            </button>
          </div>
        </div>
      </div>

      {/* Stats Section */}
      <div className="relative py-12 bg-black/40">
        <div className="container mx-auto px-6">
          <div className="grid grid-cols-1 md:grid-cols-4 gap-8">
            {[
              { label: "Total Memes Created", value: "1,337+", icon: "🎭" },
              { label: "Trading Volume", value: "$4.20M", icon: "💰" },
              { label: "Active Traders", value: "69K+", icon: "👥" },
              { label: "Avg. ROI", value: "420%", icon: "📈" }
            ].map((stat, index) => (
              <div key={index} className="text-center p-6 bg-white/5 rounded-xl backdrop-blur-sm hover:transform hover:scale-105 transition-all">
                <div className="text-4xl mb-2">{stat.icon}</div>
                <div className="text-3xl font-bold text-purple-400">{stat.value}</div>
                <div className="text-gray-400">{stat.label}</div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Features Section with Meme-style Cards */}
      <section id="features" className="relative py-20">
        <div className="container mx-auto px-6">
          <h2 className="text-4xl font-bold text-center mb-16">
            Much Features, Very Wow! 🐕
          </h2>
          <div className="grid md:grid-cols-3 gap-8">
            {[
              {
                title: "One-Click Meme Magic",
                description: "Create your meme token faster than you can say 'To The Moon!' 🚀",
                icon: "🎯",
                delay: 0
              },
              {
                title: "Diamond Hands Protection",
                description: "Advanced bonding curve keeps paper hands away. HODL with confidence! 💎",
                icon: "🔒",
                delay: 200
              },
              {
                title: "Ape-Proof Liquidity",
